                                                  <li><span style="color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 14px;"><span id="lbl_Description">Our Real Carbon Fiber comes with a&nbsp;<strong>High Gloss Finish&nbsp;</strong></span></span></span></span></li>
                                                  <li><span style="color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 14px;"><span id="lbl_Description">The High Gloss finish is a Polyurethane Clear Protective Coating applied over Carbon Fiber, to protect against UV Damage, Scratching, and Spills</span></span></span></span></li>
                                                  <li><span style="color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 14px;"><span id="lbl_Description">This High Gloss Finish Coating also provides a&nbsp;<strong>Beveled Edge</strong>&nbsp;on all the trim pieces to give a clean finish</span></span></span></span></li>
                                                  <li><span style="color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 14px;"><span id="lbl_Description">All pieces are&nbsp;<strong>Laser Cut</strong>, for Precision Fit on your Cars Interior.</span></span></span></span></li>
                                                  <li><span style="color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 14px;"><span id="lbl_Description">This is a Flat (2D) Dash Kit - Kit Installs over OEM pieces, No need to remove any parts</span></span></span></span></li>
