                                                  <li><span style="color: rgb(255, 255, 255);"><span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 14px;">&nbsp;&nbsp;Just Wipe Surface Clean, and apply Trim.</span></span></span></li>
